export async function getStaticProps() {
    // Run API calls in parallel
    const [articles, categories, blogpage] = await Promise.all([
      fetchAPI("/articles?status=published"),
      fetchAPI("/categories"),
      fetchAPI("/homepage"),
    ]);
  
    return {
      props: { articles, categories, blogpage },
      revalidate: 1,
    };
  }

